import React, { useState } from 'react';
import './Sell.css'; // Add CSS for styling

const SellPage = () => {
  const [isRegistered, setIsRegistered] = useState(false); // Check if user is registered
  const [step, setStep] = useState(1); // Steps for guided process
  const [carDetails, setCarDetails] = useState({
    make: '',
    model: '',
    year: '',
    kilometers: '',
    price: '',
    condition: 'New',
    transmission: '',
    fuel: '',
    images: [],
    contactInfo: '',
    description: '',
  });

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setCarDetails({ ...carDetails, [name]: value });
  };

  const handleNextStep = () => {
    setStep(step + 1);
  };

  const handlePreviousStep = () => {
    setStep(step - 1);
  };

  const handleRegistration = () => {
    // Logic for registration (assume success)
    setIsRegistered(true);
  };

  const handleImageUpload = (e) => {
    const files = Array.from(e.target.files);
    setCarDetails({ ...carDetails, images: [...carDetails.images, ...files] });
  };

  const handleSaveDraft = () => {
    console.log('Draft saved:', carDetails);
    alert('Your draft has been saved!');
  };

  const handleSubmit = () => {
    console.log('Car listed:', carDetails);
    alert('Your car has been listed for sale!');
  };

  if (!isRegistered) {
    return (
      <div className="sell-page">
        <h2>You need to register before selling a car.</h2>
        <button onClick={handleRegistration}>Register / Login</button>
      </div>
    );
  }

  return (
    <div className="sell-page">
      <h2>Sell Your Car</h2>

      {step === 1 && (
        <div className="step">
          <h3>Step 1: Car Information</h3>
          <div className="form-group">
            <label>Make</label>
            <input type="text" name="make" value={carDetails.make} onChange={handleInputChange} required />
          </div>
          <div className="form-group">
            <label>Model</label>
            <input type="text" name="model" value={carDetails.model} onChange={handleInputChange} required />
          </div>
          <div className="form-group">
            <label>Year</label>
            <input type="number" name="year" value={carDetails.year} onChange={handleInputChange} required />
          </div>
          <div className="form-group">
            <label>Kilometers</label>
            <input type="number" name="kilometers" value={carDetails.kilometers} onChange={handleInputChange} required />
          </div>
          <div className="form-group">
            <label>Condition</label>
            <select name="condition" value={carDetails.condition} onChange={handleInputChange}>
              <option value="New">New</option>
              <option value="Used">Used</option>
              <option value="Damaged">Damaged</option>
            </select>
          </div>
          <button onClick={handleNextStep}>Next</button>
        </div>
      )}

      {step === 2 && (
        <div className="step">
          <h3>Step 2: Additional Details</h3>
          <div className="form-group">
            <label>Price</label>
            <input type="number" name="price" value={carDetails.price} onChange={handleInputChange} required />
          </div>
          <div className="form-group">
            <label>Transmission</label>
            <select name="transmission" value={carDetails.transmission} onChange={handleInputChange}>
              <option value="Automatic">Automatic</option>
              <option value="Manual">Manual</option>
            </select>
          </div>
          <div className="form-group">
            <label>Fuel Type</label>
            <select name="fuel" value={carDetails.fuel} onChange={handleInputChange}>
              <option value="Petrol">Petrol</option>
              <option value="Diesel">Diesel</option>
              <option value="Hybrid">Hybrid</option>
              <option value="Electric">Electric</option>
            </select>
          </div>
          <button onClick={handlePreviousStep}>Previous</button>
          <button onClick={handleNextStep}>Next</button>
        </div>
      )}

      {step === 3 && (
        <div className="step">
          <h3>Step 3: Upload Images & Description</h3>
          <div className="form-group">
            <label>Upload Images</label>
            <input type="file" multiple onChange={handleImageUpload} />
          </div>
          <div className="form-group">
            <label>Additional Description</label>
            <textarea
              name="description"
              value={carDetails.description}
              onChange={handleInputChange}
              placeholder="Describe your car (condition, features, etc.)"
            />
          </div>
          <button onClick={handlePreviousStep}>Previous</button>
          <button onClick={handleNextStep}>Next</button>
        </div>
      )}

      {step === 4 && (
        <div className="step">
          <h3>Step 4: Contact Information</h3>
          <div className="form-group">
            <label>Contact Info</label>
            <input type="text" name="contactInfo" value={carDetails.contactInfo} onChange={handleInputChange} required />
          </div>
          <button onClick={handlePreviousStep}>Previous</button>
          <button onClick={handleSaveDraft}>Save as Draft</button>
          <button onClick={handleSubmit}>Submit</button>
        </div>
      )}

      {step === 5 && (
        <div className="preview">
          <h3>Preview Your Listing</h3>
          <p><strong>Make:</strong> {carDetails.make}</p>
          <p><strong>Model:</strong> {carDetails.model}</p>
          <p><strong>Year:</strong> {carDetails.year}</p>
          <p><strong>Kilometers:</strong> {carDetails.kilometers} km</p>
          <p><strong>Price:</strong> ${carDetails.price}</p>
          <p><strong>Fuel:</strong> {carDetails.fuel}</p>
          <p><strong>Transmission:</strong> {carDetails.transmission}</p>
          <p><strong>Description:</strong> {carDetails.description}</p>
          <p><strong>Contact Info:</strong> {carDetails.contactInfo}</p>
          <button onClick={handlePreviousStep}>Edit</button>
          <button onClick={handleSubmit}>Submit</button>
        </div>
      )}
    </div>
  );
};

export default SellPage;
